import '../Styles/App.css';
import Header from './Header';
import Cards from './Cards';
import mydata from '../Assets/Data';

function App() {
  return (<>
    <Header/>,
    {
      mydata.map()
    }
    mydata.map
    <Cards key={mydata.key} props={mydata}/>
    </>
  );
}

export default App;
